import torch
import torch.nn.functional as F

class BeamSearchDecoder:
    def __init__(self, model, beam_width, max_len, sos_token, eos_token, device):
        self.model = model
        self.beam_width = beam_width
        self.max_len = max_len
        self.sos_token = sos_token
        self.eos_token = eos_token
        self.device = device

    def beam_search(self, src_input):
        batch_size = src_input.size(0)
        enc_output, hidden, cell = self.model.encoder(src_input)

        # Initialize the beam search output tensor and scores tensor
        beam_search_output = torch.zeros((batch_size, self.max_len), dtype=torch.long, device=self.device)
        beam_scores = torch.zeros((batch_size, self.beam_width), dtype=torch.float, device=self.device)
        beam_scores[:, 1:] = float('-inf')  # Initialize with negative infinity except for the first beam

        # Initialize the input tensor for the decoder (start with SOS token)
        trg_input = torch.tensor([[self.sos_token]] * batch_size, device=self.device)

        # Iterate over each time step
        for t in range(1, self.max_len):
            # Forward pass through the decoder
            decoder_output, hidden, cell = self.model.decoder(trg_input, enc_output, hidden, cell)
            decoder_output = F.log_softmax(decoder_output, dim=-1)

            # Compute cumulative scores for each beam
            beam_output = decoder_output.unsqueeze(1).repeat(1, self.beam_width, 1)
            beam_output = beam_output.view(batch_size * self.beam_width, -1)
            beam_scores = beam_scores.unsqueeze(2) + beam_output

            # Select top-k scores and indices
            topk_scores, topk_ids = torch.topk(beam_scores.view(batch_size, -1), self.beam_width, dim=-1)

            # Update beam search output and scores
            beam_search_output[:, t] = topk_ids[:, 0]  # Store the top-k predictions
            beam_scores = topk_scores

            # Prepare next input for the decoder
            trg_input = topk_ids[:, 0].unsqueeze(1)

        return beam_search_output

